

SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";



CREATE TABLE `ci_sessions` (
  `id` varchar(128) NOT NULL,
  `ip_address` varchar(45) NOT NULL,
  `timestamp` int(10) UNSIGNED NOT NULL DEFAULT '0',
  `data` blob NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






CREATE TABLE `file` (
  `id` int(11) NOT NULL,
  `name` varchar(255) NOT NULL,
  `description` varchar(255) NOT NULL,
  `keywords` text NOT NULL,
  `src` varchar(255) NOT NULL,
  `type_name` varchar(100) NOT NULL,
  `type_id` int(11) NOT NULL,
  `parent_id` int(11) NOT NULL,
  `question_id` int(11) NOT NULL,
  `number` int(11) NOT NULL,
  `free` varchar(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






CREATE TABLE `messages_room` (
  `id` int(11) NOT NULL,
  `sender` varchar(50) NOT NULL,
  `recipient` varchar(50) NOT NULL,
  `message` text NOT NULL,
  `timestamp` int(10) UNSIGNED NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






CREATE TABLE `position` (
  `id` int(11) NOT NULL,
  `position` varchar(255) NOT NULL,
  `keywords` varchar(255) NOT NULL,
  `parent_id` int(11) UNSIGNED NOT NULL,
  `license_type` tinyint(1) DEFAULT NULL,
  `number` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;





CREATE TABLE `pupil_data` (
  `id` int(11) NOT NULL,
  `username` varchar(20) NOT NULL,
  `lesson_id` varchar(100) NOT NULL,
  `lesson_name` varchar(100) NOT NULL,
  `question_result` int(10) NOT NULL,
  `interactive_result` int(10) NOT NULL,
  `timestamp` int(11) UNSIGNED NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE `questions` (
  `id` int(11) NOT NULL,
  `position_id` int(11) NOT NULL,
  `question_type` int(11) NOT NULL,
  `question` text NOT NULL,
  `answers` varchar(255) NOT NULL,
  `correct_answer` int(11) NOT NULL,
  `hint_lessons_id` varchar(50) NOT NULL,
  `question_id` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;





CREATE TABLE `teachers_data` (
  `id` int(11) NOT NULL,
  `username` varchar(20) NOT NULL,
  `lesson_id` int(11) NOT NULL,
  `start_time` varchar(5) NOT NULL,
  `end_time` varchar(5) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE `users` (
  `id` int(11) NOT NULL,
  `username` varchar(20) NOT NULL,
  `password` varchar(35) NOT NULL,
  `first_name` varchar(40) NOT NULL,
  `last_name` varchar(40) NOT NULL,
  `status` varchar(40) NOT NULL,
  `gender` varchar(40) NOT NULL,
  `age` int(11) NOT NULL,
  `email` varchar(50) NOT NULL,
  `activation_code` varchar(100) NOT NULL,
  `activation` varchar(100) NOT NULL,
  `activation_schoolclick` int(10) NOT NULL,
  `permission` varchar(100) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






CREATE TABLE `users_license_code` (
  `license_code` varchar(10) NOT NULL,
  `username` varchar(20) NOT NULL,
  `description` varchar(255) NOT NULL,
  `license_type` varchar(100) NOT NULL,
  `position_id` int(11) NOT NULL,
  `mount_count` int(10) NOT NULL,
  `start_time` varchar(13) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;





ALTER TABLE `ci_sessions`
  ADD KEY `ci_sessions_timestamp` (`timestamp`);


ALTER TABLE `file`
  ADD PRIMARY KEY (`id`);


ALTER TABLE `messages_room`
  ADD PRIMARY KEY (`id`);


ALTER TABLE `position`
  ADD PRIMARY KEY (`id`);


ALTER TABLE `pupil_data`
  ADD PRIMARY KEY (`id`);


ALTER TABLE `questions`
  ADD PRIMARY KEY (`id`);


ALTER TABLE `teachers_data`
  ADD PRIMARY KEY (`id`);


ALTER TABLE `users`
  ADD PRIMARY KEY (`id`),
  ADD UNIQUE KEY `username` (`username`);


